import TextFormField from "../../components/widget/TextFormField";
import style from "./LoginPage.module.css";
import { EmailSharp } from "@material-ui/icons";
import BackgroundScreen from "../../components/widget/BackgroundScreen";

const LoginPage = (props) => {
  return (
    <div className={style.container}>
      <div className={style.child}>
        <TextFormField lable="Email" icon={<EmailSharp />} />
      </div>
      <div className={style.background}>
        <BackgroundScreen />
      </div>
    </div>
  );
};

export default LoginPage;
